import React from 'react';
import {
  ListContainer,
  FornecedorCard,
  Logo,
  Info,
  Rating,
  Stats
} from './styles';

const FornecedoresList = ({ fornecedores, consumoMensal }) => {
  // Filtra fornecedores pelo limite mínimo
  const fornecedoresFiltrados = fornecedores.filter(
    f => Number(consumoMensal) >= f.limiteMinimo
  );

  return (
    <ListContainer>
      {fornecedoresFiltrados.map(fornecedor => (
        <FornecedorCard key={fornecedor.id}>
          <Logo src={fornecedor.logo} alt={`Logo ${fornecedor.nome}`} />
          <Info>
            <h3>{fornecedor.nome}</h3>
            <p>Estado: {fornecedor.estado}</p>
            <p>Custo por kWh: R$ {fornecedor.custoKwh}</p>
            <p>Limite mínimo: {fornecedor.limiteMinimo} kWh</p>
          </Info>
          <Stats>
            <p>{fornecedor.totalClientes} clientes</p>
            <Rating>
              {fornecedor.avaliacao} ⭐
            </Rating>
          </Stats>
        </FornecedorCard>
      ))}
    </ListContainer>
  );
};

export default FornecedoresList;
